import os
import streamlit.components.v1 as components

_RELEASE = True

if not _RELEASE:
    _component_func = components.declare_component(
        "image_carousel",
        url="http://localhost:3000",
    )
else:
    parent_dir = os.path.dirname(os.path.abspath(__file__))
    build_dir = os.path.join(parent_dir, "design/build")
    _component_func = components.declare_component("image_carousel", path=build_dir)


def image_carousel(imgs, texts=None, show_count=None, slide_count=None, key=None):
    component_value = _component_func(imgs=imgs, texts=texts, show_count=show_count, slide_count=slide_count, key=key, default=None)
    return component_value


